import React, {useState} from 'react';
import Servers from './Servers';

function SideDisplayList(props) {
    const [servers, setServers] = useState([{name: "OSPP"}]);

    return (
        <div className="flex flex-col">
            <div className="bg-gray-200 border-solid border-b-2 border-black h-20"> 
                Profile
            </div> 
            <div className="bg-gray-400 border-solid border-b-2 border-black h-auto">
                <div> 
                    {servers.map((server, index) => (
                        <Servers key ={index} server = {server}/>
                    ))}
                </div>
            </div>
            <div className="bg-gray-600 rounded-full text-center h-auto"> 
                <h1 className="text-3xl border-solid border-b-2 border-black">
                    +
                </h1>
            </div>



        </div>
    )
}


export default SideDisplayList;
